function signup (email,password) {
    const fetch = async () => {
      try {

        const response = await axios.post(
          `https://pre-onboarding-selection-task.shop/auth/signup`, {
             email,password
          }, {
            headers: {
             "Content-Type":"application/json",
              "Access-Control-Allow-Origin":"*",
            }
          }
          , 
        )
        return true
      }
     catch (error) {
        return false
      }
    }
    fetch()
}

export default signup;
